import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PostList from './components/PostList';
import PostDetail from './components/PostDetail';
import PostForm from './components/PostForm';
import { appStyles } from './AppStyles';

function App() {
  return (
    <Router>
      <div style={appStyles.app}>
        <header style={appStyles.header}>
          <h1>Starbucks Blogs</h1>
          <nav>
            <ul style={appStyles.nav}>
              <li style={appStyles.navItem}><Link to="/" style={appStyles.navLink}>Home</Link></li>
              <li style={appStyles.navItem}><Link to="/new" style={appStyles.navLink}>Create New Post</Link></li>
            </ul>
          </nav>
        </header>
        <main style={appStyles.main}>
          <Routes>
            <Route path="/" element={<PostList />} />
            <Route path="/post/:id" element={<PostDetail />} />
            <Route path="/new" element={<PostForm />} />
            <Route path="/edit/:id" element={<PostForm />} />
          </Routes>
        </main>
        <footer style={appStyles.footer}>
          <p>&copy; 2023 Starbucks Blogs. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
